import React from 'react'
import './App.css';

function App() {
  return (
    <div className="App">
     <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Res enim concurrent contrariae. Piso igitur hoc modo, vir optimus tuique, ut scis, amantissimus. Non enim iam stirpis bonum quaeret, sed animalis. 

Nam illud vehementer repugnat, eundem beatum esse et multis malis oppressum. Quae tamen a te agetur non melior, quam illae sunt, quas interdum optines. Duo Reges: constructio interrete. Sic enim censent, oportunitatis esse beate vivere. Scripta sane et multa et polita, sed nescio quo pacto auctoritatem oratio non habet. Est, ut dicis, inquit; Roges enim Aristonem, bonane ei videantur haec: vacuitas doloris, divitiae, valitudo; Haec para/doca illi, nos admirabilia dicamus. Recte, inquit, intellegis. 

Intrandum est igitur in rerum naturam et penitus quid ea postulet pervidendum; Scientiam pollicentur, quam non erat mirum sapientiae cupido patria esse cariorem. Claudii libidini, qui tum erat summo ne imperio, dederetur. Beatus sibi videtur esse moriens. Dici enim nihil potest verius. Nam si propter voluptatem, quae est ista laus, quae possit e macello peti? Si longus, levis; Nec vero alia sunt quaerenda contra Carneadeam illam sententiam. Stuprata per vim Lucretia a regis filio testata civis se ipsa interemit. Primum Theophrasti, Strato, physicum se voluit; 

Illud dico, ea, quae dicat, praeclare inter se cohaerere. Poterat autem inpune; Optime, inquam. Sic enim censent, oportunitatis esse beate vivere. Fortasse id optimum, sed ubi illud: Plus semper voluptatis? Quorum sine causa fieri nihil putandum est. Utinam quidem dicerent alium alio beatiorem! Iam ruinas videres. Uterque enim summo bono fruitur, id est voluptate. </p>


    </div>
  );
}

export default App;
